 array\" ${PROJECT_DIR}/${PRODUCT_NAME}/info.plist\n    \n    /usr/libexec/PlistBuddy -c \"Add :CFBundleIcons~ipad:CFBundleAlternateIcons:'$i':CFBundleIconFiles:0 String '$i'\" ${PROJECT_DIR}/${PRODUCT_NAME}/info.plist\n    \ndone\n\n\n#echo \"Add :CFBundleIcons~ipad:CFBundleAlternateIcons:${themesNames[0]} dict\"\n\n#remove generated icons so that in case of theme removal we have a fresh set of icons\nrm -r ${PROJECT_DIR}/${PRODUCT_NAME}/Icon/AppIcon.appiconset/\n\n#/usr/libexec/PlistBuddy -c \"Delete :CFBundleIcons~ipad\"\n\n\n\n#/usr/libexec/PlistBuddy -c \"Add :CFBundleIcons~ipad:CFBundleAlternateIcons:'Test dwa':CFBundleIconFiles array\" ${PROJECT_DIR}/${PRODUCT_NAME}/info.plist\n\n#/usr/libexec/PlistBuddy -c \"Add :CFBundleIcons~ipad:CFBundleAlternateIcons:'Test dwa':CFBundleIconFiles:0 string DUPA\" ${PROJECT_DIR}/${PRODUCT_NAME}/info.plist\n\n";
